import React, { useContext, useState, useEffect } from "react";
import { AuthContext } from "../AuthContext";
import axios from "axios";
import "../styles/Dashboard.css";

const Dashboard = () => {
  const { logout } = useContext(AuthContext);
  const [fotocopiadoras, setFotocopiadoras] = useState([]); // Estado para almacenar fotocopiadoras
  const [search, setSearch] = useState(""); // Estado del buscador
  const [mostrarReserva, setMostrarReserva] = useState(false); // Estado para mostrar la tabla

  // FunciÃ³n para obtener fotocopiadoras disponibles
  const fetchFotocopiadoras = async () => {
    try {
      const response = await axios.get("http://localhost:5000/api/fotocopiadoras/disponibles");
      setFotocopiadoras(response.data);
      setMostrarReserva(true); // Solo mostrar la tabla cuando se presiona "Reserva"
    } catch (error) {
      console.error("Error obteniendo las fotocopiadoras:", error);
    }
  };

  const handleLogout = () => {
    logout();
    window.location.href = "/login";
  };

  return (
    <div className="dashboard">
      <header className="dashboard-header">
        <div className="logo">
          <div className="circle"></div>
          <h1>TecnoQuito</h1>
        </div>
        <nav className="menu">
          <ul>
            <li>
              <a href="#" onClick={(e) => { e.preventDefault(); fetchFotocopiadoras(); }}>
                Reserva
              </a>
            </li>
            <li><a href="#">Compra</a></li>
            <li><a href="#">Alquiler</a></li>
          </ul>
        </nav>
        <button className="logout-btn" onClick={handleLogout}>Cerrar SesiÃ³n</button>
      </header>

      <main className="dashboard-main">
        <h2>Bienvenido a TecnoQuito</h2>
        <p>Ofrecemos servicios de reserva, compra y alquiler de fotocopiadoras empresariales.</p>

        {/* Mostrar tabla solo si se ha activado "Reserva" */}
        {mostrarReserva && (
          <>
            {/* Buscador */}
            <input
              type="text"
              placeholder="Buscar fotocopiadora..."
              value={search}
              onChange={(e) => setSearch(e.target.value)}
            />

            {/* Tabla de fotocopiadoras */}
            <table className="fotocopiadoras-table">
              <thead>
                <tr>
                  <th>Modelo</th>
                  <th>Marca</th>
                  <th>UbicaciÃ³n</th>
                  <th>AcciÃ³n</th>
                </tr>
              </thead>
              <tbody>
                {fotocopiadoras
                  .filter(foto => foto.modelo.toLowerCase().includes(search.toLowerCase()))
                  .map(foto => (
                    <tr key={foto.idfotocopiadora}>
                      <td>{foto.modelo}</td>
                      <td>{foto.marca}</td>
                      <td>{foto.ubicacion}</td>
                      <td><button>Reservar</button></td>
                    </tr>
                  ))}
              </tbody>
            </table>
          </>
        )}
      </main>
    </div>
  );
};

export default Dashboard;
